INSERT INTO `soal` VALUES ('178','14','4','<p><strong>Shin Tae-yong: Timnas U-19 Didanai Negara, Pemain Tak Serius Dicoret!</strong></p>\r\n<p>Muhammad Robbani &ndash; detikSport</p>\r\n<p><strong>Jakarta</strong> - <a href=\"https://www.detik.com/tag/shin-tae_yong\">Shin Tae-yong</a> sadar tanggung jawab berat <a href=\"https://www.detik.com/tag/timnas-indonesia-u_19\">Timnas Indonesia U-19</a> karena dibantu dana negara. Ia tak segan-segan mencoret pemain yang tidak sungguh-sungguh.</p>\r\n<p>Pemerintah melalui Kementerian Pemuda dan Olahraga (Kemenpora) bersama PSSI telah menandatangani MoU (Memorandum of Understanding). Hasilnya, PSSI pun mendapatkan bantuan dana sebesar Rp 50,6 miliar untuk persiapan Timnas U-19 bersiap ke Piala Dunia U-20 2021.</p>\r\n<p>Sejauh ini, Timnas U-19 telah menjalani latihan di Jakarta sejak, Jumat (7/8/2020). Sebanyak 30 pemain telah ditetapkan untuk berangkat ke Kroasia untuk menjalani pemusatan latihan lanjutan.</p>\r\n<p>Shin Tae-yong selaku pelatih <a href=\"https://www.detik.com/tag/timnas-indonesia-u_19\">Timnas U-19</a> ingin semua pemain yang telah terpilih untuk menjalani latihan secara sungguh-sungguh. Ia tak menutup kemungkinan bakal mencari pemain baru jika ada pemain yang berlatih setengah hati.</p>\r\n<p>\"Bisa saja beberapa pemain dipulangkan kalau pemain tersebut tidak bisa mengikuti latihan dengan baik. Jadi pemain bisa ke Eropa karena ada biaya pajak dari masyarakat Indonesia,\" kata Shin Tae-yong seusai memimpin latihan di Stadion Madya, Jakarta, Jumat (28/8).</p>\r\n<p>\"Jadi dia harus merasa bertanggung jawab dan jika sikap terhadap latihan tidak baik pasti akan kami pulangkan,\" ujarnya menambahkan.</p>\r\n<p>Rencananya Timnas U-19 akan berangkat ke Kroasia pada, Sabtu (29/8). Sebelum itu, Jack Brown cs masih akan menjalani latihan terakhir di Jakarta pada Pagi dan Sore hari.</p>\r\n<p>Nasib pemusatan latihan di Kroasia akan sangat bergantung kepastian Piala Asia U-19 2020. Kabar terbaru yang didapatkan PSSI, turnamen dua tahunan kemungkinan bakal ditunda.</p>\r\n<p>Sejauh ini PSSI memilih tetap memberangkatkan <a href=\"https://www.detik.com/tag/timnas-indonesia-u_19\">Timnas U-19</a> berangkat ke Kroasia. Jika pada akhirnya Piala Asia ditunda, pemusatan latihan akan dipindahkan ke Turki, Spanyol, atau Portugal. Negara terakhir jadi favorit destinasi pelatih asal Korea Selatan itu.</p>\r\n<p>\"Sampai saat ini roadmap yang ada baru sekadar agenda di Eropa. Setelah itu belum ada lagi,\" tutur eks Pelatih Timnas Korea di Piala Dunia 2018 itu.</p>\r\n<p>\"Saya sengaja pilih Portugal karena memang terbatas visanya untuk stay di Kroasia. Dan banyak bisa bertanding dengan tim-tim yang lebih kuat di sana,\" ucapnya.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Pertanyaan.</strong><br />Apakah sikap dari Pelatih PSSI saat ini sudah tepat dengan pernyataan &ldquo;Pemain tak serius, Dicoret!&rdquo;. Berikan pendapat kalian!</p>','2','','','','','','','','','','','','','');
INSERT INTO `soal` VALUES ('179','14','5','<p>Terkait dengan Artikel yang berjudul \"<strong>Shin Tae-yong: Timnas U-19 Didanai Negara, Pemain Tak Serius Dicoret!\" </strong>yang ada di nomor sebelumnya.</p>\r\n<p>Apakah Timnas U-19 akan bersinar pada ajang Piala Dunia U 20 tahun 2021 nanti? Berikan pendapat kalian!</p>','2','','','','','','','','','','','','','');
