INSERT INTO `soal` VALUES ('420','37','3','<p style=\"text-align: center;\"><strong>Messi Pindah dari Barcelona</strong></p>\r\n<p><strong>Liputan6.com, Barcelona-</strong> Lionel <a href=\"https://www.liputan6.com/bola/read/4340705/manchester-city-siapkan-tawaran-unik-untuk-lionel-messi\">Messi</a> dikabarkan sudah meminta dilepas oleh Barcelona. Pria Argentina itu sudah tak betah di Nou Camp yang sudah dibelanya hampir dua dekade.</p>\r\n<p>Kabar kepindahan Messi dari <a href=\"https://www.liputan6.com/bola/read/4340541/lionel-messi-ingin-tinggalkan-barcelona-begini-reaksi-real-madrid\">Barcelona</a> mencuat pekan ini. Pria 33 tahun itu diklaim sudah secara resmi meminta Barcelona melepasnya. Messi menggirimkan fax kepada Blaugrana.</p>\r\n<p>Konon di kontrak ada klausul yang mana <a href=\"https://www.liputan6.com/bola/read/4340665/lionel-messi-mengambil-risiko-sanksi-fifa-atas-sengketa-kontrak-dengan-barcelona\">Messi</a> bisa pindah dari Barcelona dengan gratis atau dengan biaya transfer 200 juta poundsterling saja.</p>\r\n<p>Usai kabar Messi ingin cabut dari Barcelona berhembus kencang, muncul teka-teki apa yang membuatnya begitu kesal dan ingin segera pindah.</p>\r\n<p>Banyak yang menduga Messi sudah kehabisan kesabaran dengan Presiden klub Josep Maria Bartomeu. Barcelona memang hancur lebur di bawah kepemimpinan Bartomeu. <a href=\"https://www.liputan6.com/tag/lionel-messi\">Messi</a> merasa tak dianggap oleh Bartomeu.</p>\r\n<p>Namun media Argentina, <em>Diario Ole</em> membeberkan alasan lain Messi ingin segera angkat kaki dari Barcelona. Pelatih baru Ronaldo Koeman yang jadi biang keroknya.</p>\r\n<p>Messi marah besar dengan ucapan Koeman saat berbincang dengan dirinya. Koeman mengatakan kepada Messi tak bakal mendapat keistimewaan lagi di Barcelona.</p>\r\n<p>\"Hak istimewa Anda di skuat sudah berakhir, Anda harus melakukan segalanya untuk tim. Saya akan menjadi tidak fleksibel, Anda harus memikirkan tim,\" kata Koemen dapat pertemuan dengan Messi.</p>\r\n<p>Begitu selesai berdiskusi dengan Koeman, Messi langsung memutuskan untuk meninggalkan Barcelona. Koeman juga kabarnya sudah memutuskan menendang pemain senior Luis Suarez.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Pertanyaan.</strong></p>\r\n<p>Hal-hal apa yang membuat pemain dunia Lionel Messi ingin pindah dari Club yang sudah dibelanya selama 2 dekade ini?</p>','2','','','','','','','','','','','','','');
INSERT INTO `soal` VALUES ('421','37','4','<p>Dari artikel pada soal sebelumnya. Berikan pendapat menurut kalian sendiri, tentang kepindahan Lionel Messi? Serta seandainya Messi pindah, Club Sepakbola manakah yang pantas untuk menampung salah satu Pemain Terbaik Dunia ini, berikan alasannya!</p>','2','','','','','','','','','','','','','');
INSERT INTO `soal` VALUES ('422','37','5','<h1 class=\"434\">Atlet Terkaya, Apa Saja Kerajaan Bisnis Mendiang Kobe Bryant?</h1>\r\n<p><strong>TEMPO.CO</strong>, <strong>Jakarta</strong> -Pebasket profesional <a href=\"https://bisnis.tempo.co/read/1300101/kala-erick-thohir-kenang-momen-terakhirnya-bersama-kobe-bryant\" target=\"_blank\" rel=\"noopener\">Kobe Bryant</a> meninggal dunia dengan putrinya dalam kecelakaan pesawat helikopter pada 26 Januari 2020. Sepanjang karirnya, Kobe Bryant&nbsp;dikenal sebagai atlet terkaya dengan pundi-pundi lebih dari&nbsp;US$ 500 juta.</p>\r\n<p>Selama karier NBA-nya di Los Angeles Lakers, Kobe Bryant&nbsp;memperoleh gaji lebih dari $328 juta. Beberapa kontrak penting termasuk perpanjangan tiga tahun senilai $90 juta ditandatangani pada 2010. Pada 2013 ia menandatangani perpanjangan 2 tahun sebesar $48,5 juta.&nbsp;Dia juga memperoleh sekitar $350 juta dari kerjasama atau endorsment. Selama tahun terakhirnya di NBA, Kobe menghasilkan $25 juta.&nbsp;</p>\r\n<p>Lalu, bagaimana dia membangun kerajaan bisnisnya? Pemain basket berusia 41 tahun itu memulai investasinya di tahun 2013 ketika masih aktif berlaga di lapangan.&nbsp;Saat itu, Kobe Bryant&nbsp;membuka perusahaan modal ventura Bryant Stibel bekerja sama dengan Jeff Stibel founder Web.com.</p>\r\n<p>Bryant Stibel mengklaim setidaknya 10 jenis investasi yang sukses, termasuk Dell dan Alibaba. Dia juga memiliki investasi dalam Fortnite Epic Games, perusahaan pembayaran digital Klarna dan perusahaan produk rumah tangga The Honest Company.</p>\r\n<p>Terpisah dari perusahaan, Kobe Bryant juga menghasilkan jutaan dolar dari investasinya dalam minuman olahraga Body Armor, yang pada 2018 mendorong penilaiannya dengan menjual saham ke Coca Cola.</p>\r\n<p>Reputasi Bryant sebagai atlet bintang dan pembangun merek telah menjadi salah satu kunci kesuksesan portofolio. Pada 2016, Bryant mendirikan Granity Studios, sebuah perusahaan media yang berfokus pada penceritaan kreatif seputar olahraga.</p>\r\n<p>Melalui perusahaan ini, bintang bola basket itu menulis dan meriwayatkan sebuah film pendek berjudul \"Dear Basketball,\" yang memenangkan Academy Award untuk film pendek animasi terbaik pada tahun 2018. Granity juga telah merilis satu set buku untuk orang dewasa muda, bersama dengan autobiografi Bryant, \" The Mamba Mentality: How I Play. \"</p>\r\n<p>Bryant, yang dikenal dalam bola basket sebagai \"Black Mamba,\" mulai membangun mereknya sebagai atlet di awal karirnya sebagai pendukung Nike (NKE).&nbsp;Bryant pertama kali menandatangani perjanjian dengan Nike pada tahun 2003. Dia adalah salah satu dari sekelompok pemain elit NBA yang menandatangani kontrak dengan merek tersebut tahun itu, termasuk LeBron James dan Carmelo Anthony.</p>\r\n<p>Kontrak itu membantu perusahaan sepatu tersebut memperkuat posisinya di dunia bola basket selama beberapa dekade berikutnya setelah pensiunnya Michael Jordan pada 2003.</p>\r\n<p>Seiring kesuksesan Bryant di lapangan, demikian pula kemitraan Nike-nya. Merek ini mengeluarkan beberapa baris sepatu dan perlengkapan Kobe.</p>\r\n<p>Nike bermitra dengan Bryant dan Los Angeles Boys and Girls Club untuk meluncurkan liga bola basket anak muda, yang disebut Liga Mamba, pada 2017, untuk memberi ratusan anak akses gratis ke olahraga. Bryant kemudian mendirikan Akademi Olahraga Mamba untuk memberikan pelatihan atletik dan gaya hidup yang lebih luas kepada para pesaing di semua tingkatan dalam sejumlah olahraga.</p>\r\n<p>Pada 2015, Kobe Bryant&nbsp;bekerjas sama dengan Alibaba Group untuk merilis film dokumenter bintang bola basket \"Kobe Bryant\'s Muse\" melalui Tmall Magic Box TV di Cina.&nbsp;Kesepakatan itu juga melibatkan kerja sama dengan Bryant untuk menciptakan platform media sosial baru \"yang membawa jalan baru untuk menghubungkan orang-orang muda Cina secara langsung ke Kobe dan filosofinya,\" menurut siaran pers dari Alibaba yang mengumumkan kemitraan.</p>\r\n<p>Selain itu, perusahaan menjual sejumlah produk bermerek Kobe di platform ritelnya. <a href=\"https://bisnis.tempo.co/read/1300034/erick-thohir-mengenang-pertemuan-terakhir-dengan-kobe-bryant\" target=\"_blank\" rel=\"noopener\">Kobe&nbsp;Bryant</a> juga memiliki kesepakatan kerjasama dengan sejumlah merek lain sepanjang kariernya, termasuk McDonald\'s (MCD), Sprite, Nintendo (NTDOF) dan Turkish Airlines.</p>\r\n<p>Pertanyaan.</p>\r\n<p>Jelaskan apa yang membuat Kobe Bryant menjadi Atlet Terkaya? Apa saja bisnis yang kobe punya?</p>','2','','','','','','','','','','','','','');
