INSERT INTO `soal` VALUES ('551','35','18','<p>Pundi-pundi&nbsp; kas negara kini mencapai 156 triliun per 7 Mi 2010. Surplus APBN merupakan gabungan antara pendapatan dari sektor perpajakan ditambah dengan penarikan pinjaman kemudian dikurangi dengan belanja. Meski demikian, surplus ini bukanlah hal yang rnembanggakan, sebab rendahnva penyerapan belanja yang menyebabkan fungsi anggaran sebagai pendorong perekonomian tnenjadi kurangefektif.</p>\r\n<p><br />Guna mendorong kualitas penyerapan anggaran, Kementerian Keuangan akan menerapkan mekanisme reward and punishment. Artinya, bagi lembaga yang tidak bisa menyerap anggaran dengan baik pada 2010, maka pagu anggaran untuk 2011 akan dipotong. Lambatnya penyerapan anggaran selama mi menunjukkan belum seriusnya pemerintah dalam mencari solusi. Untuk membantu kelancaran penyerapan anggaran ini, proses administrasi yang terlalu berbelit-belit harus disederhanakan</p>\r\n<p>Gagasan utama teks editorial adalah&hellip;.</p>','1','<p>Pundi-pundi kas negara kita sedang mengalami kenaikan puncak pada tanggal 7 Juli 2010</p>','<p>Surplus APBN didapat dari sektor perpajakan ditambah dengan penarikan pinjaman</p>','<p>Pemerintah memberlakukan rnekanisme reward and punishment pada tahun anggaran 2011</p>','<p>Upaya penyederhanaan proses administrasi perlu dilaksanakan demi cepatnya penyerapan anggaran</p>','<p>Lambatnya penyerapan anggaran selama mi menunjukkan belum seriusnya pemerintah dalam mencari solusi.</p>','D','','','','','','','');
