INSERT INTO `soal` VALUES ('554','35','19','<p>Pundi-pundi&nbsp; kas negara kini mencapai 156 triliun per 7 Mi 2010. Surplus APBN merupakan gabungan antara pendapatan dari sektor perpajakan ditambah dengan penarikan pinjaman kemudian dikurangi dengan belanja. Meski demikian, surplus ini bukanlah hal yang rnembanggakan, sebab rendahnva penyerapan belanja yang menyebabkan fungsi anggaran sebagai pendorong perekonomian tnenjadi kurangefektif.</p>\r\n<p><br />Guna mendorong kualitas penyerapan anggaran, Kementerian Keuangan akan menerapkan mekanisme reward and punishment. Artinya, bagi lembaga yang tidak bisa menyerap anggaran dengan baik pada 2010, maka pagu anggaran untuk 2011 akan dipotong. Lambatnya penyerapan anggaran selama mi menunjukkan belum seriusnya pemerintah dalam mencari solusi. Untuk membantu kelancaran penyerapan anggaran ini, proses administrasi yang terlalu berbelit-belit harus disederhanakan.</p>\r\n<p>Kalimat yang menyatakan fakta pada teks editorial tersebut terdapat &hellip;</p>\r\n<p>&nbsp;</p>','1','<p>kalimat pertama paragraf pertama</p>','<p><br />kalimat ketiga paragraf pertama</p>','<p>kalimat kedua paragraf kedua</p>','<p>kalimat ketiga paragraf kedua</p>','<p>kalimat kedua paragraf pertama</p>','A','','','','','','','');
INSERT INTO `soal` VALUES ('555','35','20','<p>Pemerintah kembali menurunkan bahan bakar minyak (BBM) terutama jenis premium. Bersamaan dengan penurunan harga premium untuk kedua kalinya, harga bahan bakar jenis solar pun diturunkan. Harga minyak dunia yang terus merosot mendorong munculnya kebijakan penurunan BBM.<br />Kalangan industri mestinya sudah bisa menghitung kembali biaya produksi yang berujung pada penurunan harga. Apalagi, harga bahan bakar industri pun mengalami hal yang sama.<br />Dengan turunnya harga premium dan solar, diharapkan harga kebutuhan pokok ikut turun. Dengan demikian, daya beli publik terangkat, diikuti peningkatan konsumsi yang mendorong peningkatan produksi. Hal itu mampu memperkecil peluang terjadinya pemutusan hubungan kerja (PHK).</p>\r\n<p>Gagasan utam tajuk tersebut adalah</p>','1','<p>Penurunan harga BBM hendaknya diikuti harga kebutuhan pokok</p>','<p><br />Penurunan harga premium diikuti solar dan pertamax</p>','<p>Kebutuhan pokok tergantung jenis BBM yang digunakan</p>','<p>Turunnya BBM meningkatkan produksu dalam negeri</p>','<p>Kalangan industri mestinya sudah bisa menghitung kembali biaya produksi yang berujung pada penurunan harga.</p>','A','','','','','','','');
